import React, { Component } from 'react';
import render from 'react-dom';
import logo from './logo.svg';
import './App.css';
import Greet from './components/Greet';
import Hello from './components/hello';


class App extends Component {
  render(){
    return (
    <div className="App">
      <Greet name="shivam"/>
      <Hello/>
    </div>
    );
  }
}

export default App;
